import * as React from "react";
import {
  StatusBar,
  Image,
  FlatList,
  Dimensions,
  Animated,
  Text,
  View,
  StyleSheet,
  SafeAreaView,
  TouchableOpacity,
} from "react-native";
const { width } = Dimensions.get("screen");
import MaterialCommunityIcons from "@expo/vector-icons/MaterialCommunityIcons";
import { useFonts } from "@expo-google-fonts/dev";
import {
  FlingGestureHandler,
  Directions,
  State,
} from "react-native-gesture-handler";

const DATA = [
  {
    title: "Welcome to my resume app",
    poster:
      "https://images.squarespace-cdn.com/content/v1/59d195afcf81e0a1cd99b680/1601019159275-XX23OOK1UW4E1V7QEOYY/matthew-t-rader-zq4UnZoy5AQ-unsplash.jpg",
  },
  {
    title: "Proceed",
    poster:
      "data:image/jpeg;base64,",
  },
  {
    poster:
      "data:image/jpeg;base64,"
  },
];

const OVERFLOW_HEIGHT = 70;
const SPACING = 10;
const ITEM_WIDTH = width * 0.76;
const ITEM_HEIGHT = ITEM_WIDTH * 1.7;
const VISIBLE_ITEMS = 3;

export const CarouselSlide = ({ navigation }) => {
  const [data, setData] = React.useState(DATA);
  const scrollXIndex = React.useRef(new Animated.Value(0)).current;
  const scrollXAnimated = React.useRef(new Animated.Value(0)).current;
  const [index, setIndex] = React.useState(0);
  const setActiveIndex = React.useCallback((activeIndex) => {
    scrollXIndex.setValue(activeIndex);
    setIndex(activeIndex);
  });
  let [fontsLoaded] = useFonts({
    Arizonia: require("../../assets/fonts/Arizonia-Regular.ttf"),
    Fredoka: require("../../assets/fonts/FredokaOne-Regular.ttf"),
    Island: require("../../assets/fonts/UnifrakturCook-Bold.ttf"),
  });

  const OverflowItems = ({ data, scrollXAnimated }) => {
    const inputRange = [-1, 0, 1];
    const translateY = scrollXAnimated.interpolate({
      inputRange,
      outputRange: [OVERFLOW_HEIGHT, 0, -OVERFLOW_HEIGHT],
    });

    const Skip = () => {
      navigation.navigate("DrawerTabs");
    };
    return (
      <View style={styles.overflowContainer}>
        <Animated.View style={{ transform: [{ translateY }] }}>
          {data.map((item, index) => {
            return (
              <View key={index} style={styles.itemContainer}>
                <Text style={[styles.title]} numberOfLines={1}>
                  {item.title}
                </Text>

                <View style={styles.fastforward}>
                  <TouchableOpacity onPress={Skip}>
                    <MaterialCommunityIcons
                      name="fast-forward"
                      size={32}
                      color="#FF6089"
                    />
                  </TouchableOpacity>
                </View>
              </View>
            );
          })}
        </Animated.View>
      </View>
    );
  };

  React.useEffect(() => {
    if (index === data.length - VISIBLE_ITEMS - 1) {
      // get new data
      // fetch more data
      const newData = [...data, ...data];
      setData(newData);
    }
  });

  React.useEffect(() => {
    Animated.spring(scrollXAnimated, {
      toValue: scrollXIndex,
      useNativeDriver: true,
    }).start();
  });

  if (fontsLoaded) {
    return (
      <FlingGestureHandler
        key="left"
        direction={Directions.LEFT}
        onHandlerStateChange={(ev) => {
          if (ev.nativeEvent.state === State.END) {
            if (index === data.length - 1) {
              return;
            }
            setActiveIndex(index + 1);
          }
        }}
      >
        <FlingGestureHandler
          key="right"
          direction={Directions.RIGHT}
          onHandlerStateChange={(ev) => {
            if (ev.nativeEvent.state === State.END) {
              if (index === 0) {
                return;
              }
              setActiveIndex(index - 1);
            }
          }}
        >
          <SafeAreaView style={styles.container}>
            <StatusBar hidden />
            <OverflowItems data={data} scrollXAnimated={scrollXAnimated} />
            <FlatList
              data={data}
              keyExtractor={(_, index) => String(index)}
              horizontal
              inverted
              contentContainerStyle={{
                flex: 1,
                justifyContent: "center",
                padding: SPACING * 2,
                marginTop: 50,
              }}
              scrollEnabled={false}
              removeClippedSubviews={false}
              CellRendererComponent={({
                item,
                index,
                children,
                style,
                ...props
              }) => {
                const newStyle = [style, { zIndex: data.length - index }];
                return (
                  <View style={newStyle} index={index} {...props}>
                    {children}
                  </View>
                );
              }}
              renderItem={({ item, index }) => {
                const inputRange = [index - 1, index, index + 1];
                const translateX = scrollXAnimated.interpolate({
                  inputRange,
                  outputRange: [50, 0, -100],
                });
                const scale = scrollXAnimated.interpolate({
                  inputRange,
                  outputRange: [0.8, 1, 1.3],
                });
                const opacity = scrollXAnimated.interpolate({
                  inputRange,
                  outputRange: [1 - 1 / VISIBLE_ITEMS, 1, 0],
                });

                return (
                  <Animated.View
                    style={{
                      position: "absolute",
                      left: -ITEM_WIDTH / 2,
                      opacity,
                      transform: [
                        {
                          translateX,
                        },
                        { scale },
                      ],
                    }}
                  >
                    <Image
                      source={{ uri: item.poster }}
                      style={{
                        width: ITEM_WIDTH,
                        height: ITEM_HEIGHT,
                        borderRadius: 14,
                      }}
                    />
                  </Animated.View>
                );
              }}
            />
          </SafeAreaView>
        </FlingGestureHandler>
      </FlingGestureHandler>
    );
  }
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    justifyContent: "center",
    backgroundColor: "#000",
  },
  title: {
    fontSize: 20,
    fontFamily: "Island",
    color: "#fff",
  },
  itemContainer: {
    height: OVERFLOW_HEIGHT * 2,
    padding: SPACING * 2,
  },
  itemContainerRow: {
    flexDirection: "row",
    justifyContent: "space-between",
    alignItems: "center",
  },
  overflowContainer: {
    height: OVERFLOW_HEIGHT,
    overflow: "hidden",
  },
  fastforward: {
    paddingLeft: 300,
    bottom: 30,
    left: 10,
  },
});
